// MovingImage.js
import React from 'react';

const MovingImage = () => {
  return (
  <>
<div>
<div className='bg-gray-600 pl-4 pr-4 text-center w' style={{fontSize:"12px",color:"white"}}>
  <span>--------------Project---------------- </span><br/>
Alshifa pharmacy<br/>
It's dynamic E-commerce website <br/>
using React js with hooks(useEffect,useState,useContext,useRef,Props)<br/>
Tailwinds,Bootstrap(Grid,Flex,Swiper,animation)



  </div>
    <div className="image-slider-container">
    <div className="image-slider">
     
     
      
   
      <img src="Fo.png" alt="Image 5" />
      <img src="thr.png" alt="Image 4" />
      <img src="cart.png" alt="Image 3" />
      <img src="tow.png" alt="Image 2" />
      <img src="one.png" alt="Image 1" />
    </div>
  </div>

  </div>
  </>
  );
};

export default MovingImage;
